iet my doctor placed me on, would be helpful. I am the daughter of Debby Freeland, who contacted Kelsey Main about dietary needs.\n',3,'2014-05-15 02:08:40'),(1521,2,'ParticipantRegistration',507,'User',NULL,'update','--- \nmobile_phone: \n- 913-481-7255\n- 913-481-7255\nstreet: \n- |-\n  16313 S. Brentwood St.\n  16313 S. Brentwood St.\n- |-\n  16313 S. Brentwood St.\r\n  16313 S. Brentwood St.\n',35,'2014-05-15 02:08:40'),(1522,198,'ParticipantRegistration',507,'User',NULL,'update','--- \nshirt_size: \n- \n- Medium\n',2,'2014-05-15 02:08:40'),(1523,11,'ParticipantRegistration',507,'User',NULL,'update','--- \nmobile_phone: \n- 530-345-8811\n- 530-345-8811\n',34,'2014-05-15 02:08:40'),(1524,15,'ParticipantRegistration',507,'User',NULL,'update','--- \nmobile_phone: \n- 724-664-5859\n- 724-664-5859\n',30,'2014-05-15 02:08:40'),(1525,174,'ParticipantRegistration',507,'User',NULL,'update','--- \nmobile_phone: \n- 614-282-6046\n- 614-282-6046\n',13,'2014-05-15 02:08:41'),(1526,100,'ParticipantRegistration',507,'User',NULL,'update','--- \nmobile_phone: \n- 865-850-8301\n- 865-850-8301\n',19,'2014-05-15 02:08:41'),(1527,58,'ParticipantRegistration',507,'User',NULL,'update','--- \nspecial_needs_details: \n- |-\n  I am extremely asthmatic and must be in air conditioning.  Please lodge me (and my husband) where there is good AC, and not a mold problem, so that my asthma doesn\'t flare up.   Perfumes and Smoke are huge asthma triggers, so if at all possible, can you request people to abstain from wearing perfumes?  Thank you so much!  3 other people in our group also have perfume triggers for asthma, so this would help our whole group out.\n  \n  I am unable to do stairs (can do a couple if absolutely needed), so I must be in lodging that either has an elevator or is on the first floor.  I will probably be renting either an Amigo or a golf cart to get around campus on as I have a bad knee.  Food allergies are due to diverticulitis (not peanut allergy) but should not contain nu