nd microwave. I cannot eat gluten, dairy (cows milk), and have several other food allergies. (Eating out anywhere is always a challenge to get enough to eat to sustain my energy needs therefore having a refrigerator and microwave would be helpful so I can bring in some extra food to supplement my meals. I have medications/supplements that need refrigerated too.\n  \n  My Northeast Indiana District co-coach (adult daughter)  also has similar food allergies, along with seasonal allergies, and will have medications/supplements that need refrigerated too.)\n',5,'2014-05-16 20:34:26'),(1732,159,'ParticipantRegistration',548,'User',NULL,'update','--- \nspecial_needs_details: \n- |-\n  Food Allergies: Gluten, Diary, Green Beans, Mushrooms, Oats, Yeast\r\n  \r\n  Due to getting migraines from fragrances (especially ones that have just been applied), I need either my specified room mate or one who uses only fragrance free products.\r\n  \r\n  Due to allergies to pollen, please place me in an air conditioned room.\r\n  \r\n  Also having access to a refrigerator and a microwave, to me stay on the diet my doctor placed me on, would be helpful. I am the daughter of Debby Freeland, who contacted Kelsey Main about dietary needs.\n- |-\n  Food Allergies: Gluten, Diary, Green Beans, Mushrooms, Oats, Yeast\n  \n  Due to getting migraines from fragrances (especially ones that have just been applied), I need either my specified room mate or one who uses only fragrance free products.\n  \n  Due to allergies to pollen, please place me in an air conditioned room.\n  \n  Also having access to a refrigerator and a microwave, to me stay on the diet my doctor placed me on, would be helpful. I am the daughter of Debby Freeland, who contacted Kelsey Main about dietary needs.\n',4,'2014-05-16 20:34:26'),(1733,275,'ParticipantRegistration',548,'User',NULL,'create','--- \nhousing_saturday: false\ndeparture_airline: \nmost_recent_grade: \nnum_sv_tickets: \nministry_project_id: \nnum_extra_medium_sh