INSERT INTO `evaluations` VALUES (1,'9688d6a9c49df19f056910ace9d657ea','Scott & Sara Christensen','CCDQUIZ@yahoo.com',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-01-29 00:10:41','2014-01-29 00:10:41','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(2,'789fb3f94b69e9f24da1535b4c46b658','Bill Horning','horningwlh@gmail.com',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-01-29 00:10:41','2014-01-29 00:10:41','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(3,'f16d17def4a9e6d81cacb5d896963d58','Stephen Hruska','stephenhruska@gmail.com',2,1,'Stephen Hruska',14,'Quizmaster','Pretty much...everywhere...all the time.  I don\'t remember every single time at this point, so I\'m not bothering to check all the boxes above.','5 - Exceeds expectations','Todd is one of the best quizmasters I know, and a couple teens have told me he\'s their favorite one.','4 - Meets or exceeds most expectations','I don\'t have anything negative to say, but also nothing to push me to say Todd always exceeds expectations--my expectations are high in general.','4 - Meets or exceeds most expectations','Todd uses his content judge as appropriate and doesn\'t get many challenges/appeals.  Not a 5 for knowledge of the material since I\'m pretty sure he doesn\'t have it all memorized (which would be what exceeds my expectations).','5 - Exceeds expectations','Decisions are well thought out','District Director','2014-02-02 00:45:34','2014-03-03 06:13:10','--- \n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','Regional','Todd enjoys interacting with others and is decisive in his rulings in a way that maintains a positive quizzing environment.','No specific issues come to mind, so I don\'t have any concerns here.','Looks to them for confirmation on verses and according to\'s, and as needed for difficult rulings.','He should probably be allowed to be a quizmaster at Q.  Maybe.'),(4,'b5d8549122e0d4b2b99aa1c41d20672e','Bill Horning','horningwlh@gmail.com',2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-02 00:45:35','2014-02-02 00:45:35','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(5,'78179a52a06ab5d7490329925fa6cb81','Martha Baker','marthabaker1040@gmail.com',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-04 20:50:31','2014-02-04 20:50:31','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(6,'95cdc5b5788df3105f7c8518eb029a8e','Bill Horning','horningwlh@gmail.com',3,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-04 20:50:32','2014-02-04 20:50:32','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(7,'9a27fa6188c8046e7735c7550702eed5','Bud Stiles','hstiles@usbr.gov or bitbender@inorbit.com',4,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-04 21:16:24','2014-02-04 21:16:24','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(8,'a07822445af4f377b3c17247baa9d377','Robert Flowers','reviceman@att.net',5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-05 01:23:02','2014-02-05 01:23:02','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(9,'12eb323bfc53372d6d52f2ff69406037','Bill Horning','horningwlh@gmail.com',5,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-05 01:23:03','2014-02-05 01:23:03','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(10,'edb12341029c07b7ed849063a2942f45','Melissa Mullen','Mejamu@juno.com',6,1,'Melissa Mullen',48,'Quizmaster','I have observed this official at Q (district and regional division), regional events, St Louis, invitationals, and district events.  I have lost track of which years for which events - 1994 to present.','5 - Exceeds expectations','consistent, don\'t stumble over words','4 - Meets or exceeds most expectations','time is not an issue.  I keep my rounds moving.  and that doesn\'t change my rulings.  I have been known to be more lenient at the first district quiz of the year for a new team, for example.  rulings are based on scripture and my experience rather than the situation','5 - Exceeds expectations','often don\'t have a content judge, but if I do try to give them specific jobs and ask their opinion.  don\'t have many challenges.  if the challenge is over something I have already considered, I usually don\'t grant it.  it is usually only accepted if they present information I have not considered before.','5 - Exceeds expectations','I was on the committee that reviewed and updated the rules.  I used to be an according to quizzer and can \"listen fast\"... multiple questions have never been an issue','District Director','2014-02-05 16:04:33','2014-05-19 21:10:48','--- \n- 2008 - Q2008 - NNU\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','Regional','well, I think.  I laugh and joke a lot.','apologize as necessary, try to take the high road','listen on memory verses, assign a specific job on according tos (ie I will listen for the specific question, you be sure they don\'t go out of the verse), clarification on something I didn\'t hear, etc','I feel like I do a great job, know the rules, know the material, and keep the quiz moving.  I love it.'),(11,'9c66e62d2c171b4c7275cddd892a4ed3','Darrik Acre','piedmontnaz@att.net',6,1,'Darrik Acre',50,'Quizmaster','I cannot remember what years I have seen Melissa quiz master at which events, so I did not mark many of them.\r\nI do know that Melissa has been a Quizmaster in a variety of Regional tournaments, at the South Central Region\'s Extravaganza event, and at Q events in the past.\r\nShe is a quality and experienced quizmaster.','4 - Meets or exceeds most expectations','Consistent, well-paced question reader.','4 - Meets or exceeds most expectations','Hard to sway her rulings once made because she deliberates very carefully before making a ruling.\r\n','4 - Meets or exceeds most expectations','Melissa coaches at her local church and has a pretty thorough knowledge of the material.','4 - Meets or exceeds most expectations','As a former quizzer and long time quiz leader, Melissa has a excellent knowledge of the rules.','Regional Director','2014-02-05 16:04:34','2014-02-05 16:20:29','--- \n- Regional Invitational (Experienced)\n','District Experienced','Well','Well','Well',''),(12,'f3f8b7c6f2f19440e8916254b328927d','Jan Shoopman','janmshoopman@gmail.com',7,1,'Jan Shoopman',62,'Quizmaster','','4 - Meets or exceeds most expectations','Very rarely hesitates.  Very clear when pre-announcing and reading questions.  Consistent in stopping as soon as the tone sounds.','4 - Meets or exceeds most expectations','I have never seen him show any bias in any round I have watched.  He keeps his emotions neutral.  He does not seem to show frustration or change his demeanor when pressed for time.','4 - Meets or exceeds most expectations','Is very knowledgeable of content, but does not hesitate to confer with content judge, if needed.  Appears to have an equal ratio of accepted/denied challenges.  Does not show preference to either acceptance or denial.','4 - Meets or exceeds most expectations','Has a very thorough knowledge of rules and abides by them without hesitation.  Handles difficult questions/answers, appeals, ties and other things calmly and efficiently.','District Director','2014-02-06 16:18:53','2014-02-10 20:44:35','--- \n- 2011 - Southeast USA Regional Event\n- 2012 - Southeast USA Regional Event\n- 2013 - Southeast USA Regional Event\n- District Invitational (Novice)\n- District Invitational (Experienced)\n','Regional','Matt likes to have a good rapport with those he comes into contact with.  This good rapport in turn earns him a level of respect in the quiz round.  He handles all contact professionally, with a side of fun.  He encourages all those he comes into contact with.  May appear to be \'short\' to those who have not \'learned\' him yet, but quickly dispels that.','If a \'personal\' conflict arises (such as with a coach/quizzer), he tries to distance himself from the issue as to not exacerbate the issue.  In \'professional\' conflict, he maintains composure and continues on, willing to discuss the issue after a round.','Matt is a very confident quizmaster, both in knowledge of the content and understanding of quizzing rules.  His judgments are generally quick and concise, but he will confer with his content judge if there is a question or doubt.  Also uses content judge effectively during challenges/appeals.','While I have not witnessed him at every event that I know he has been involved in (previous Qs, St. Louis invitational, etc), I know that Matt has a love and passion for Bible Quizzing.  He would be a great asset to any tournament.'),(13,'07fc284df89274e7d8c17966a56876be','Matt Thrasher','matt.thrasher@jefferson.kyschools.us',7,1,'Matt Thrasher',62,'Quizmaster','I see myself officiate every time I Quizmaster----you have seen me too, Todd.','4 - Meets or exceeds most expectations','Fairly consistent--always pauses where ever there is punctuation---even on verses.','4 - Meets or exceeds most expectations','Knows material well, when in doubt, uses the content judge for other points of view.','4 - Meets or exceeds most expectations','Very few challenges are accepted--usually original ruling has been thought out clearly with feedback of content judge.  Challenges have to bring to light something that the QM and CJ had not thought of, or be very persuasive regarding why the original ruling should be reversed.','5 - Exceeds expectations','Has been on the rules committee in past years.','Regional Director','2014-02-06 16:18:54','2014-02-07 00:14:40','--- \n- 2008 - St. Louis Top Ten All-Star Quiz\n- 2009 - St. Louis Top Ten All-Star Quiz\n- 2010 - Q2010 - MVNU\n- 2010 - St. Louis Top Ten All-Star Quiz\n- 2011 - St. Louis Top Ten All-Star Quiz\n- 2012 - Q2014 - ONU\n- 2013 - St. Louis Top Ten All-Star Quiz\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','District Experienced','Keeps quizzes moving along----not much time for chit chat in between questions.  Lovable person.','There is no such thing as conflict.  Handles situations that can be dealt with in the quiz area, and if persons are still unsatisfied, directs them to those who can deal with issues.  However, in issues within the individual quiz rounds, the Quiz Master has the final say over any matter within that round.','To double check accuracy of all quotations and memory verses, all According to questions, any time a multiple is given as well as any time there is just a question about whether the quizzer has totally answered the question correctly.','Todd should not have moved back to Wisconsin.  Ricky Dean misses him so much.  Since Todd moved to Wisconsin, Kentucky has had more snow than Wisconsin.'),(14,'206e911ab18e0bbe2eb931748843ecbe','Mary Beckworth','mbeckworth@springtownisd.net',8,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-07 18:51:57','2014-02-07 18:51:57','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(15,'92d41ec73627dea47e2b93301685e042','Darrik Acre','piedmontnaz@att.net',8,1,'Darrik Acre',50,'Quizmaster','I have seen Mark serve as a quizmaster at a variety of events but am uncertain of dates.','4 - Meets or exceeds most expectations','Mark reads questions well.','4 - Meets or exceeds most expectations','Mark is consistent.','4 - Meets or exceeds most expectations','Mark is an experienced quizmaster.','4 - Meets or exceeds most expectations','Mark is an experienced quizmaster.','Regional Director','2014-02-07 18:51:58','2014-02-10 16:06:09','--- \n- 2012 - South Central USA Regional Event\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','District Experienced','Mark interacts with everyone around him well.','Good.','Good.',''),(16,'827be04c2ddc08f6f661f19c9d23e8a8','James Moots','trajam@zoominternet.net',9,1,'James Moots',25,'Quizmaster','I have observed Jeremy at both the district and regional level.  I have also interacted with him at district quizzes.  ','5 - Exceeds expectations','Jeremy has an excellent cadence as a quizmaster.   He is very consistent in reading questions and stopping.   He has very good enunciation.','4 - Meets or exceeds most expectations','Jeremy does well in his rulings.  ','5 - Exceeds expectations','Jeremy seems to have a better than average knowledge of the rules and quiz procedures.   ','5 - Exceeds expectations','I have no issues placing Jeremy in varsity.  He can handle multiple questions, etc. ','District Director','2014-02-09 13:57:59','2014-02-21 02:34:25','--- \n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Novice)\n','District Experienced','Jeremy is always a pleasure to interact with.  He helps with any assignment I give him and provides helpful feedback about the day.  He seems to interact in a friendly way with quizzers and coaches.','Jeremy adapts to the different circumstances happening at a quiz.  He can speed up if things fall behind (for reasons outside his control).','I have not seen this extensively but do know that Jeremy used his content judge quite a bit when he had one.','I have only know Jeremy since Q2012 and more so in the last year so I have not known him a long time.   However, he has been a pleasure to have on our district and is a good quizmaster.   My impression is that he could handle and would probably be better suited to the higher levels of quizzing at Q.'),(17,'e67d2dfa3894302ac3fb52023a588017','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',9,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-09 13:58:00','2014-02-09 13:58:00','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(18,'c7bd92b582029d7091777e2d356bc798','Taryn Williams','tmew83@hotmail.com',10,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NU