en to challenges/appeals, utilize content judge and rules as well as scriptural context to rule.  He always takes time to listen, and does not hurry through rounds to get done.','4 - Meets or exceeds most expectations','uses content judge especially on specialty and challenges/appeals\r\n','5 - Exceeds expectations','scott has a good working knowledge of the rules','District Director','2014-02-16 23:00:44','2014-02-19 18:45:00','--- \n- 2008 - Q2008 - NNU\n- 2010 - Q2010 - MVNU\n- 2012 - Q2014 - ONU\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','Regional','scott interacts with everyone in a cheerful positive manner','scott is pretty mild mannered and adapts to change easily.  he also is willing to take time after rounds to explain heated rulings.  ','well.  on specialty, and challenge/appeal specifically',''),(24,'bd74ad75ccbade6f37ea929af91e99d0','Bill Horning','horningwlh@gmail.com',13,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-16 23:00:45','2014-02-16 23:00:45','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(25,'a6abd1c718f31e15902b60c4818e31c7','Becky Seville','creedlily@yahoo.com',14,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-18 04:57:45','2014-02-18 04:57:45','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(26,'995dd97147c5351f2a9f3e42fd533783','Darrik Acre','piedmontnaz@att.net',14,1,'Darrik Acre',50,'Quizmaster','I have seen Stan serve as a Quizmaster at a variety of events: Invitationals, District Quizzes, Regional Events, Q Events, and St. Louis Top Ten Quizzes; though I am not sure of dates because he sometimes coaches at these events as well. ','4 - Meets or exceeds most expectations','Stan reads questions well.','4 - Meets or exceeds most expectations','Stan has an extensive history in Teen Bible Quizzing as both a coach and official.  His rulings reflect that experience and consistency.','4 - Meets or exceeds most expectations','Stan serves as a coach at his local church and is well acquainted with Romans and James.','5 - Exceeds expectations','No one knows quizzing better than Stan.','Regional Director','2014-02-18 04:57:46','2014-02-18 16:12:48','--- \n- 2013 - South Central USA Regional Event\n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','District Experienced','Stan interacts with others well.','Stan may not always be happy about conflicts/changes, but he adapts well and moves forward.','Because of his experience, Stan is sometimes left without a content judge at quiz events; but utilizes well the content judges assistance when one is available.',''),(27,'12b5cb5a386f36fca6bc8e0a27f9fbeb','James Moots','trajam@zoominternet.net',15,1,'James Moots',25,'Quizmaster','I have observed Tracie as a quizmaster at many district events, regional events, Q2012, world style tournaments, etc.  I am also her husband.','5 - Exceeds expectations','Tracie stops quickly and consistently.  She has an easy to follow and clear cadence.  ','5 - Exceeds expectations','Tracie is very consistent in her rulings.   She has remained consistent in tournament finals and high pressure situations.  ','4 - Meets or exceeds most expectations','Tracie works very well with her content judges.   Content judges will often request to work with her.   She will accept a challenge if merited but usually takes enough time with her initial ruling that a challenge is not necessary.  The only reason she doesn\'t get a 5 is that she has not been studying the material herself this year.','5 - Exceeds expectations','Tracie is very good at handling multiple questions and multiple answer situations.  She has a better understanding of the rules than most coaches and other officials.   She can handle appeals, multiple lights coming on at the same time, etc.','District Director','2014-02-21 02:39:43','2014-03-17 12:03:37','--- \n- 2010 - Eastern USA Regional Event\n- 2012 - Eastern USA Regional Event\n- 2012 - Q2014 - ONU\n- 2013 - Eastern USA Regional Event\n- District Invitational (Novice)\n- District Invitational (Experienced)\n','District Experienced','Tracie is very friendly and is often making new friends with the quizzers and coaches.   She also keeps control of the room.','Tracie maintains her composure well.  Even when coaches have lost their composure in her room she has maintained composure and been able to finish out rounds without further incident.','Tracie works very well with content judges. ','Tracie prefers to quizmaster at the district or local novice level at the national events.  That would be her preference.   She is quite capable of being a quizmaster at the district or local experienced levels if needed and is very flexible.'),(28,'73970a5941a6d492737363c0ed215b93','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',15,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-21 02:39:44','2014-02-21 02:39:44','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(29,'cf1e199e4e3795e8d3e817a027b8bdcb','Vernon Reihle','vern@spokanebethelnaz.org',16,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-24 20:18:34','2014-02-24 20:18:34','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(30,'0cf21d34fbdce3464c7d29a016216d96','Henry Miller','hchhquiz@msn.com',16,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-24 20:18:35','2014-02-24 20:18:35','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(31,'e18e1a1404aeeeee2d002caf86316d71','Bill Horning','horningwlh@gmail.com',17,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-25 00:44:52','2014-02-25 00:44:52','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(32,'5a438c875de815c4e67820c04d741211','Robert Flowers','reviceman@att.net',18,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-02-25 01:49:49','2014-02-25 01:49:49','--- []\n\