egional','I think she does very well with those in charge of the event. Most coaches and quizzers like her. I thinks she does fine in this area--average.','Sometimes she can get a little irritable, but overall does a good job with this.','Very well.','Pat is very experienced and does a very good job.'),(43,'d40f812730c43c60ae0e7599a93ac542','Chad Lynn','chadandmegan@comcast.net',23,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-03-10 20:44:34','2014-03-10 20:44:34','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(44,'1a6b544085d9b230c53c5b9990590fca','Stephen Hruska','stephenhruska@gmail.com',24,1,'Stephen Hruska',14,'Quizmaster','All over the place...when he actually comes.','5 - Exceeds expectations','Really good, not known for bleeding at all','4 - Meets or exceeds most expectations','No specific reason for a 5, but no concerns.','3 - Meets average expectations','Haven\'t seen Aaron at all this year, so I\'m not sure how much of the material he knows.  Uses content judge as I would expect, and gets few challenges.','4 - Meets or exceeds most expectations','No specific reason for a 5, but no concerns.  Very confident, and ruls with authority.','District Director','2014-03-11 03:26:26','2014-03-12 00:00:37','--- \n- District Invitational (Novice)\n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','Regional','Interacts well with quizzers/adults.','Deals with conflict just fine.  He\'ll stand firm in his decisions and I don\'t think he\'s bothered if people disagree with him.','Looks for confirmation on memory verses and content of according to\'s, discusses challenges/appeals as appropriate.','Very good.  Wish he was able to come to our district quizzes more often.'),(45,'dd3448c0f3a24456d1964b4aa80ecbd1','Bill Horning','horningwlh@gmail.com',24,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-03-11 03:26:27','2014-03-11 03:26:27','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(46,'019e21b6b040797304e1a9547b99188a','Todd Butler','tmbutler04@gmail.com',25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-03-14 10:45:23','2014-03-14 10:45:23','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(47,'4e33f4d57447c0734e54ea5ec1fdf0bf','Chad Lynn','chadandmegan@comcast.net',25,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-03-14 10:45:24','2014-03-14 10:45:24','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(48,'196ec68ab0db95f4ac5f8216cb4df806','Penny Pogue','ppogue3@comcast.net',26,1,'Penny Pogue',74,'Quizmaster','I have only observed Jerry at the District quiz meets, where he serves as a Quiz Master.  However, I know that he has been a Quizmaster at PLNU for the Southwest region (field) in the past.','5 - Exceeds expectations','Because he has been involved with the quizzing program for many years, he is careful to read questions loudly and clearly.  He always stops when a tone sounds.  I have noticed that he will read the question to himself silently before he attempts to read it to the quizzers.','5 - Exceeds expectations','Jerry is one of the most consistent and fair quizmasters I have seen.  He shows no favoritism and treats everyone with equal respect.  He rules based on the scripture and the type of question.  Once he is certain there will be no challenge, he will sometimes give an explanation for why he ruled as he did so that the quizzers will have a better understanding. ','5 - Exceeds expectations','When we are lucky enough to have someone as a content judge, he doesn\'t hesitate to utilize them.  I\'m not certain about the ratio of challenge to the ones that are accepted by him, however, he goes to the scripture to justify why he rules as he does.  He takes the time to explain his answer so that the quizzers can learn from it.','5 - Exceeds expectations','When there are multiple questions/answers, he is OK with the answers being out of order as long as all answers are given.  When there are appeals, he gives them as much consideration as he does with challenges.  For ties, he uses only the general questions and awards/penalizes no points to the individual.  he has a very good understanding of the rules and how they are applied to various situations.','District Director','2014-03-15 20:08:17','2014-03-15 23:59:11','--- \n- District Invitational (Novice)\n- District Invitational (Experienced)\n','Regional','Jerry is one of the easiest Quizmasters to get along with.  He relates well to the quizzers.  The coaches trust his judgment because of his experience and how he backs all decisions with scripture and rules. As far as working with those in charge of the event, Jerry is willing to help out in whatever way he is needed.  He is there to minister to the youth through the quizzing program.','Jerry adapts very well to changes in circumstances.  If a conflict arises, he seeks a way to resolve it in the best possible manner.','On the NM district, we typically don\'t have enough officials to have a content judge.  However, on the occasions when we do have them, Jerry consults with them on any challenges and any ruling that he turns to the scripture for before making a decision.  He understands the value of the content judge and knows that they may have heard something that maybe he missed.  He values the input of others.','Jerry is one of the best quiz masters I have seen.  He knows the material because he studies it all year, just like the quizzers do.  He relates well with the quizzers and they love him on the NM district.  He is always encouraging the quizzers and challenging them to learn more about the scripture they are quizzing on.  He would be an asset to any official position in a quizzing tournament.'),(49,'a8b3e01f386b8378aa4cbb776efac9ac','John Shearer','shearerfamily@att.net',26,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-03-15 20:08:18','2014-03-15 20:08:18','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(50,'cb5b0af08e394d0a56996b250e253375','Tate Lo