ce','I do know Bill to be a warm and friendly person who interacts well with others.','From what I have seen, Bill handles potential conflicts in calm, even-headed manner.','I have not witnessed Bill as a Quizmaster.','I think highly of Bill as a person and believe he does a great job as District Director for Teen Bible Quizzing in SW Oklahoma.  But I have not seen him officiate.  Based on his character and experience in teen quizzing I would recommend him, but I cannot comment on his officiating skills.'),(88,'76c26da6108a57fd7f05d60b27b827a7','Roger Sauter','rlsauter@gmail.com',46,1,'Roger Sauter',45,'Quizmaster','Have observed at all levels for many years.','5 - Exceeds expectations','Very consistent in her reading.','5 - Exceeds expectations','Consistent and fair in her rulings. doesn\'t get rattled.','5 - Exceeds expectations','Consults with content judge as needed. Few challenges, accepts as appropriate, but not often.','4 - Meets or exceeds most expectations','Distills thru the questions well.','District Director','2014-04-05 17:18:25','2014-04-15 03:15:32','--- \n- 2008 - Northwest USA Regional Event\n- 2008 - Q2008 - NNU\n- 2009 - Northwest USA Regional Event\n- 2010 - Northwest USA Regional Event\n- 2010 - Q2010 - MVNU\n- 2011 - Northwest USA Regional Event\n- 2012 - Northwest USA Regional Event\n- 2012 - Q2014 - ONU\n- 2013 - Northwest USA Regional Event\n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','Regional','Interacts great with quizzers. Good to have a woman quiz master at the highest level, given the number of female quizzers at this level.','Adapts well. Handles herself well in conflicts.','Consults as needed, not real often.','Do not receive any negative feedback about this person, at the district/invitational/regional events that I coordinate.'),(89,'5b003adf39f6288ca721958b5bf43fbc','Henry Miller','hchhquiz@msn.com',46,1,'Henry Miller',42,'Quizmaster','We have observed Lori for over 25 years at NNC-NNU.  She is calm, firm and interested in Quizzers.  Lori and Roger have teamed up together to host a wonderful Washington Invitational in Vancouver and Portland for years with great success.  Connie and I highly recommend her.  ','5 - Exceeds expectations','Lori is the cream of the crop!','5 - Exceeds expectations','Calm and fair.','5 - Exceeds expectations','If needed she will utilize a content judge.','5 - Exceeds expectations','Lori knows her rules!','Regional Director','2014-04-05 17:18:26','2014-04-06 04:24:15','--- \n- 2008 - Northwest USA Regional Event\n- 2009 - Northwest USA Regional Event\n- 2010 - Northwest USA Regional Event\n- 2011 - Northwest USA Regional Event\n- 2012 - Northwest USA Regional Event\n- 2013 - Northwest USA Regional Event\n- Regional Invitational (Experienced)\n','Regional','Polite and considerate.','Calm and firm','With a smile and uses when needed.','WE have watched Lori blossom through the years to quite the lady.'),(90,'2dc5f26866bf58f7c08d203b0213cbc3','Brandon Foskey','brandon.foskey@gmail.com',47,1,'Brandon Foskey',61,'Quizmaster','I have seen Laura officiate at every district quiz and district final event for the past several years. In addition, I\'ve seen her officiate during at least two Southeast regional quizzing events over the past five years. There may have been more than that, but I honestly can\'t remember.','5 - Exceeds expectations','Laura is very consistent and clear with her reading and stopping. As a former quizzer she is very familiar with how to properly manage her cadences and limit hesitations.','5 - Exceeds expectations','I have always sought quizmasters for our Georgia district events that are consistent in their rulings regardless of whatever other factors might be pressing (time, prelim vs. tournament, etc.) I believe that consistency is very important and Laura has displayed such consistency in her rulings for as long as I have utilized her as an official. I have never witnessed any inconsistencies myself nor have I had them brought to my attention by a coach or quizzer.','5 - Exceeds expectations','Laura is always very knowledgeable regarding the material.','5 - Exceeds expectations','Laura has had years of regional quizzing experience both as a quizzer for Georgia at TNT events and as an official. She has also experienced a high level of quizzing at her local church for the past several years (their church has been one of the top teams on Georgia\'s district for almost a decade) and thus she is very familiar with all the rules including the nuances regarding multiples, appeals, and difficult rulings.','District Director','2014-04-06 21:20:47','2014-04-07 10:31:28','--- \n- 2012 - Southeast USA Regional Event\n- 2013 - Southeast USA Regional Event\n- District Invitational (Experienced)\n','District Experienced','Laura may come across as reserved and shy at first but she is always the first to encourage quizzers and listen to the concerns of coaches if and when those arise. She is very easy to work with and has always been a great team member in Georgia\'s bank of officials for the past several years. ','Laura is one to remain calm in conflict and circumstantial difficulties. I have never seen her fly off the handle or say/do anything that would be out of line. When she has had to deal with tense situations in a round, she has always managed them in a Christ-like manner and has sought counsel from myself or other officials if necessary.','For most of quizzes on our district level, we don\'t have enough volunteers for content judges so for the majority of the time, Laura has officiated without a content judge. But when she has had one (at regional events or occasionally at district finals), she consults her content judge appropriately when a second opinion is necessary. I cannot think of a time when I have thought she underutilized or overutilized her content judge.',''),(91,'0f0d85e487dfb727fcfeb8527972d814','Matt Thrasher','matt.thrasher@jefferson.kyschools.us',47,1,'Matt Thrasher',62,'Content Judge','I put 2013 Regional event--it actually was 2014...(and 2011)','3 - Meets average expectations','She was much improved this year.  She follows directions well.  Was very consistent this year.  Could also serve as QM.','3 - Meets average expectations','Again, much improved over my last encounter with her.  ','3 - Meets average expectations','Very few challenges/appeals accepted....good use of content judge.','3 - Meets average expectations','Again, much improved....I can tell that she has been working at monthly meets on her district.','Regional Director','2014-04-06 21:20:48','2014-04-07 11:36:45','--- \n- 2011 - Southeast USA Regional Event\n- 2013 - Southeast USA Regional Event\n','Local Experienced','Very easy to work with.','No problems.','As needed for input.',''),(92,'5419e79a37be896508a103179bda32a2','Scott & Sara Christensen','CCDQUIZ@yahoo.com',48,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-14 17:29:26','2014-04-14 17:29:26','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(93,'b85aab8677a34adb553c6638d5705748','Bill Horning','horningwlh@gmail.com',48,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-14 17:29:28','2014-04-14 17:29:28','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(94,'625633e6d2c1aa19bcc73d9adde39a7e','James Moots','trajam@zoominternet.net',49,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-18 14:07:33','2014-04-18 14:07:33','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(95,'abc8855f3045be2907a04bb1f035a57c','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',49,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-18 14:07:35','2014-04-18 14:07:35','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(96,'628e1cccb830e336ea1c6e70f71151c0','Brandon Foskey','brandon.foskey@gmail.com',50,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-18 22:34:51','2014-04-18 22:34:51','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(97,'d7d3e05104c4bfabf2f025cce4f4b041','Matt Thrasher','matt.thrasher@jefferson.kyschools.us',50,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-18 22:34:53','2014-04-18 22:34:53','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(98,'3f7f6cfda5f13c58082a9b315eab0130','Roger Sauter','rlsauter@gmail.com',51,1,'Roger Sauter',45,'Quizmaster','I have served as Lori Sauter\'s content judge the last couple of Q events. But I also can quiz master at whatever level you may need someone except I will be coaching our Regional A team. Use me where you need me.','3 - Meets average expectations','Not sure how to do this for myself. Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','3 - Meets average expectations','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','3 - Meets average expectations','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','3 - Meets average expectations','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','District Director','2014-04-19 00:16:57','2014-04-19 03:19:28','--- \n- District Invitational (Experienced)\n','Local Experienced','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.','Bill Buckholdt from the Northwest district and part of the event team could give an evaluation for me.'),(99,'5b6cc19c4f7be859e9f78e4b8843dd4d','Henry Miller','hchhquiz@msn.com',51,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-19 00:16:59','2014-04-19 00:16:59','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(100,'cf84cecc8a69d14defc7eeb89fd90e2a','Penny Pogue','ppogue3@comcast.net',52,1,'Penny Pogue',74,'Quizmaster','I have only observed Jerry at District quiz meets.','5 - Exceeds expectations','Jerry tends to read over the questions to himself before he reads them to the quizzers so that he can get the proper inflections.  He is very good at stopping when the tone sounds.','5 - Exceeds expectations','Jerry is very consistent in his rulings.  He is unbiased.  He tries to explain why he ruled the way he did.....after any challenges have been completed.','5 - Exceeds expectations','Jerry knows the material very well.  He studies it all year with the quizzers.  NM district rarely has enough officials to have content judges, but when they are available, Jerry won\'t hesitate to utilize them as needed.  I can\'t say for sure what the ratio of challenges accepted are, but I know that if a good solid challenge is presented that follows the scripture involved, he will uphold it.','5 - Exceeds expectations','Jerry has been involved with the quizzing program for many years and knows the rules very well.  He applies the rules appropriately when dealing with challenges, appeals, ties, and even ruling on questions.','District Director','2014-04-21 11:51:00','2014-04-24 02:48:20','--- \n- District Invitational (Experienced)\n','Regional','Jerry gets along very well with the quizzers and coaches.  He is a favorite with both.  He is a pleasure for me to work with as a director because he will help in any way he can.','We rarely have conflicts on the NM district, but when they do arise Jerry addresses them with integrity.  Jerry is flexible about working with unexpected changes in the circumstances.','As mentioned before, we rarely have content judges available.  However, if one is available he will consult with them as needed - making sure they heard the same answer he did, discussing whether or not an answer meets the requirements for being correct, verifying scores.','While I have not seen him at Regionals, I know he has served as a quizmaster multiple times for Southwest USA.  He is very passionate about the ministry of teen Bible quizzing.  His fairness and his willingness to explain his rulings are a big part of why he is favorite among the quizzers of the NM district.'),(101,'7e7fb71f293f448331f8a32cad0fac93','John Shearer','shearerfamily@att.net',52,1,'John Shearer',75,'Quizmaster','Jerry has served the New Mexico District for many years.  Each year I have the opportunity to observe him when I travel to one of the New Mexico District meets.  I have also had Jerry as a QM for the top level competition for about 8 of the last 10 years at our Regional competition.  I also believe that he has QM\'d at a previous Q event, but I\'m not sure which years.','4 - Meets or exceeds most expectations','Jerry is very conscious of the fact that quizzers need to KNOW how a question is going to be read, and at what point the QM will stop following a jump.  Jerry does very well in this area.  This is something that I have stressed for years for my QM\'s and Jerry has met and exceeded my challenge. ','5 - Exceeds expectations','Jerry is very fair and I would say does exceptional in his ability to remain neutral and consistent. ','5 - Exceeds expectations','Jerry knows the material so well, that his rulings tend to stand the scrutiny of challenges.  Unfortunately, we rarely have the luxury of Content Judges, but when we have, Jerry has utilizes them well - listening and discussing items when appropriate.','4 - Meets or exceeds most expectations','Since Jerry has been involved with quizzing for over 20(?) years, he has seen and heard just about all.  Jerry is also a student of the Word, and as such, has handled difficult situations with poise and grace.  Jerry is fully aware of the rules and how to apply them.','Regional Director','2014-04-21 11:51:02','2014-04-21 16:52:38','--- \n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','District Experienced','Jerry has handled every interaction like the pro that he is.  He listens well, and follows any direction from the tournament director well.  Jerry is like a great big teddy bear - he looks rugged and tough, but is a really soft soul.  I have never heard Jerry raise his voice!','(See above)\r\nLet me say it again, I have never heard Jerry raise his voice.  He has handled any question or conflict with great poise and grace.  He is also not above admitting it if he made a mistake.','Again, we early have that luxury.\r\nBut several years ago, I had Jerry QM the finals for our Regional competition, we did have a Content Judge, and I was the scorekeeper.  I got a really good look and listen to how he utilized his CJ.  He relied on the CJ to have the portion open to the proper vera for all According To questions.  He went to the CJ when he wasn\'t sure, but even in the finals, didn\'t go to the CJ to affirm his every ruling, but used them only when he wasn\'t sure, or needed some input prior to his ruling.','I have absolutely no concerns for Jerry.  He is a great QM and a great man of God.\r\nI highly recommend him.'),(102,'d0fa29e8b9eed95668387799f2c99fba','Tate Love','wrnbldg@gmail.com ',53,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-23 09:45:12','2014-04-23 09:45:12','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(103,'3594c32b96f99d5045930cbe087512b7','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',53,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-23 09:45:13','2014-04-23 09:45:13','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(104,'8413a22b3255dae09f156e03c340da7a','Tate Love','wrnbldg@gmail.com ',54,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-23 09:47:52','2014-04-23 09:47:52','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(105,'b1f157a99fc5dd7b19dd3d0d085ff837','Matt and Melissa Mosher','steelersmom8@aol.com, pastormattmoser@gmail.com',54,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-04-23 09:47:53','2014-04-23 09:47:53','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(106,'8308d4dc0e3c9fdf16bea5d729427312','Rick Powers','rtrickpowers@aol.com',55,1,'Rick Powers',75,'Quizmaster','Gloria was a regional quizzer in her youth.  She quiz masters on our district every month.','5 - Exceeds expectations','She has a good grasp of the scriptures, and a quick mind.','5 - Exceeds expectations','Consistently on the mark, has always been fair in my opinion.','5 - Exceeds expectations','She quizzed over it as a teen, and studies it with her team, and has a good knowledge of the material.','5 - Exceeds expectations','Does well in all of these areas. ','District Director','2014-04-25 13:59:52','2014-04-29 02:27:14','--- \n- District Invitational (Experienced)\n','District Experienced','Gloria is a team player.  She is gracious and kind to quizzers as well as coaches. ','She deals with it rationally.  Even if it is not what she might not agree with, she goes with the consensus of the group.','The content judge is part of the team of quiz mastering.  ','Gloria is a key part of Northern California quizzing.  She is very gifted in all areas of leadership in our quizzing program. '),(107,'4e0bd68672af617945707744ad3c5ad9','John Shearer','shearerfamily@att.net',55,1,'John Shearer',75,'Quizmaster','I\'ve seen Gloria QM at District quizzes over the last several years.  She has also QM for me at our Regional quiz for the last 8(ish)years.','4 - Meets or exceeds most expectations','Gloria has been involved in quizzing for so many years, and has honed her craft well.  She pays attention to the details of the QM job.','3 - Meets average expectations','Gloria trys so hard to not appear biased, that she sometimes rules more harshly against the team with which she has a relationship.  Not real bad, but occasionally noticed.  She also feels the pressure if behind, and may not give due consideration on a difficult answer.  Again, not bad, just noticable occationally.','4 - Meets or exceeds most expectations','Gloria always knows the material so well, that her rulings stand up.  She does, however, listen to any good challenges, and occationally does reverse a previous ruling.  I would say that she does very well here.','3 - Meets average expectations','Again, she is so very well versed on the rules.  I would say that she handles the difficult areas appropriately in the novice/intermediate levels very well.  She only adequatley handles the expert level','Regional Director','2014-04-25 13:59:52','2014-04-27 00:24:14','--- \n- District Invitational (Experienced)\n- Regional Invitational (Experienced)\n','District Novice','Gloria is her own person.  She can get focused on her own thoughts, and sometimes has a difficult time hearing other opinions.','Can be a bit combative, but has been getting better the last few years.','We usually don\'t have the luxury of CJ, so it would be hard to say.  But knowing the importance of the QM position, she would likely utilize her CJ appropriately.','I would highly recommed Gloria, for any position in the Novice or Intermediate level.'),(108,'4df874cba7027ad7405683eb7141c68c','J.D. Sailors','jdnteresa@gmail.com',56,1,'J.D. Sailors',47,'Quizmaster','Truthfully, I am the person that you are asking about.  I have quiz mastered on the Dallas District the last two seasons since there is no quizzing in the Louisiana District.  I have been active on the South Central Region since 1982 and been a part of the regional quizzing event as a quiz master or regional director since 1985.  I have attended every Q event thus far - the first as a parent and every one since as a quiz master.  I have just worked the North Central (MNU) quiz for the 8th consecutive year.  I have worked TNU, ONU, NNU, and PLNU regional events in past years. ','5 - Exceeds expectations','I\'m telling you, there may not be anybody more qualified than I am.','5 - Exceeds expectations','I\'m consistent. ','5 - Exceeds expectations','Very careful. Uses hearing and judgement of content judge. ','5 - Exceeds expectations','It\'s not easy, but I am up to it. ','District Director','2014-04-30 19:41:31','2014-04-30 19:59:08','--- \n- 2008 - North Central USA Regional Event\n- 2008 - South Central USA Regional Event\n- 2009 - North Central USA Regional Event\n- 2009 - South Central USA Regional Event\n- 2009 - St. Louis Top Ten All-Star Quiz\n- 2010 - North Central USA Regional Event\n- 2010 - South Central USA Regional Event\n- 2010 - Q2010 - MVNU\n- 2010 - St. Louis Top Ten All-Star Quiz\n- 2011 - North Central USA Regional Event\n- 2011 - South Central USA Regional Event\n- 2011 - St. Louis Top Ten All-Star Quiz\n- 2012 - North Central USA Regional Event\n- 2012 - South Central USA Regional Event\n- 2012 - Q2014 - ONU\n- 2012 - St. Louis Top Ten All-Star Quiz\n- 2013 - North Central USA Regional Event\n- 2013 - South Central USA Regional Event\n- District Invitational (Experienced)\n','Regional','The young people and their parents deeply appreciate how I handle myself and how I put the quizzers at ease in my room. ','I use all the grace that I can muster.  I have apologized when I have been wrong.','They are my eyes for fouls.  They are my ears for responses.  They are my reference finder before \"according to\" questions. I ask if they \"heard\" the question, the answer or the converse on multiplies. I ask them about challenges and rebuttals.  Bud Stiles is the best content judge I have ever had. ','You might want to check with others who have observed me....but then again, you might just take my word for it. '),(109,'37f492444a0777aebb4fe467a43ec7d0','Darrik Acre','piedmontnaz@att.net',56,1,'Darrik Acre',50,'Quizmaster','I have observed J.D. as a Quizmaster at the South Central Regional Extravaganza, at all invitational quizzes in or near the South Central region (Rogers, Olathe, Oklahoma, Dallas), at St. Louis and Q events. ','5 - Exceeds expectations','J. D. in my opinion is one of the Top Ten quizmasters in the country.\r\nHe brings excellence and experience to the task.','5 - Exceeds expectations','J. D. is consistent with his rulings and is fair and balanced in his approach.','5 - Exceeds expectations','J. D. is a pastor, well versed in the Scriptures, and is often a question and /or devotional writer.\r\nHe works with his content judge as if they are important part of the officiating team.\r\nHe considers challenges fairly.','5 - Exceeds expectations','J.D. is experienced and knows well the quiz rules.','Regional Director','2014-04-30 19:41:31','2014-04-30 21:55:24','--- \n- 2008 - South Central USA Regional Event\n- 2009 - South Central USA Regional Event\n- 2010 - South Central USA Regional Event\n- 2011 - South Central USA Regional Event\n- 2012 - South Central USA Regional Event\n- 2013 - South Central USA Regional Event\n- Regional Invitational (Novice)\n- Regional Invitational (Experienced)\n','Regional','To know J.D. is to love him.  He interacts well with quizzers, coaches, spectators, etc.','J.D. interacts well with people and handles conflict calmly.','He works with his content judge as if they are important part of the officiating team.','Again, one of the best quizmasters in the country.'),(110,'e6d243282e1983c4364c1076cc4738e5','Roger Sauter','rlsauter@gmail.com',57,1,'Roger Sauter',45,'Quizmaster','Works our district quizzes and gotten feedback from regional quizzes both our district and others in the region.','4 - Meets or exceeds most expectations','Good consistency, no complaints.','4 - Meets or exceeds most expectations','Manages time well.','4 - Meets or exceeds most expectations','Have not observed this directly.\r\n','4 - Meets or exceeds most expectations','Good knowledge of quizzing and handling multiple questions.','District Director','2014-05-01 22:00:26','2014-05-06 02:10:46','--- \n- District Invitational (Experienced)\n','District Experienced','Gets along great with quizzes and coaches at the events.','Have not observed this, but not the kind of person that back down. Would deal with conflict directly.','Would consult as needed.','Been very pleased with her work.\r\n\r\nWould do well at district or local experienced.'),(111,'3d7647f537e736703e33f565e199a315','Henry Miller','hchhquiz@msn.com',57,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-05-01 22:00:27','2014-05-01 22:00:27','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(112,'d1703969665c9098b156ffd49d638490','Patrick Wheeler','patrick.wheeler@gmail.com',58,1,'Patrick Wheeler',52,'Content Judge','District quizzes and St Louis Top Ten. This season is her first involved in quizzing. She would be good as a content judge for local or district novice.','3 - Meets average expectations','NA - recommend as content judge','3 - Meets average expectations','She tries very hard for consistency as a content judge.','3 - Meets average expectations','As a content judge, she has worked well with the quizmaster, learning to be ready to assist.','2 - Does not meet some expectations','Does ok with multiples. Still learning the details of rules and how they are applied, but she has made an effort to learn and asks endless questions to understand.','District Director','2014-05-02 04:44:20','2014-05-02 05:07:50','--- \n- 2013 - St. Louis Top Ten All-Star Quiz\n- District Invitational (Novice)\n- District Invitational (Experienced)\n','Local Novice','Very easy going. Tries to be respectful of others. ','Tries to keep conflict at a minimum if at all possible.','NA - would be content judge.','This is Veronica\'s first year involved but she has learned a lot quite quickly. I expect I will start using her as a quizmaster next year. I haven\'t used her there yet just because she\'s been learning the rules.'),(113,'6bef953ce0d45ac2a963ec1226da4e3e','Darrik Acre','piedmontnaz@att.net',58,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-05-02 04:44:21','2014-05-02 04:44:21','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(114,'40e12a828755726ea8510c4efd52581c','Patrick Wheeler','patrick.wheeler@gmail.com',59,1,'Patrick Wheeler',52,'Content Judge','For this past season as an official assisting in district quizzes. She has, on occasion, acted as quizmaster in practices.','3 - Meets average expectations','Does a good job in practices. Very consistent.','3 - Meets average expectations','Still learning the rules but doing exceptionally well for first year involved.','3 - Meets average expectations','Does well as a content judge. Good at following along, having the scripture open for each question, and other things that are helpful to quizmaster.','3 - Meets average expectations','Good hearing. Has done well assisting with multiples.','District Director','2014-05-02 15:38:57','2014-05-02 16:00:48','--- \n- District Invitational (Novice)\n- District Invitational (Experienced)\n','Local Novice','Very good interpersonal skills. Able to cope with situations outside her comfort zone to meet her responsibilities.','Very forthright. Will meet conflict or changes head on, asking questions to clarify the situation if needed, and dealing with it directly, honestly, and calmly.','Relies on them heavily due to inexperience quizmastering. I have made sure in practice, as much as possible, to have someone knowledgeable of rules with her to help her learn.','Debra is helpful in any way needed. She got involved because she came to watch her brother quiz at our first quiz in September, saw I was shorthanded, and volunteered to help. She\'s been involved ever since.'),(115,'2bec72aab6f52d57261e8e1fb063a5fc','Darrik Acre','piedmontnaz@att.net',59,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-05-02 15:38:57','2014-05-02 15:38:57','--- []\n\n',NULL,NULL,NULL,NULL,NULL),(116,'66a6cb75a23dbf174f4744e326a632ea','Tamara Tolley','indyquiz@gmail.com',60,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2014-05-15 02:28:34','2014-05-15 02:28:34',