INSERT INTO `pages` VALUES (1,'Basic Information','Basic Information','','<h1>Q2014</h1>\r\n<p>June 30th - July 5th, 2014 on the campus of Trevecca Nazarene University in Nashville, TN.</p>\r\n<p>Hope to see you there!</p>\r\n<h3>Tentative Schedule (download PDF)&nbsp;<a title=\"Q2014 Tentative Schedule\" href=\"http://www.quizstuff.com/Q2014 General Schedule (2014.04.01).pdf\" target=\"_blank\">click here</a>.</h3>\r\n<p>Officials, pre-register your interest <a title=\"Q2014 Officials Page\" href=\"/officials/new\" target=\"_blank\">here</a>. &nbsp;(Only register at one of these two links, not both)</p>',1,1,'2014-01-29 00:15:05','2014-05-08 14:52:30'),(2,'Officials and Volunteer Registration','Officials and Volunteer Registration','','<h1>Q2014</h1>\r\n<p>June 30th - July 5th, 2014 on the campus of Trevecca Nazarene University in Nashville, TN.</p>\r\n<p>Hope to see you there!</p>\r\n<p>Officials, register your interest&nbsp;<a title=\"Q2014 Officials Page\" href=\"/officials/new\" target=\"_blank\">here</a>. &nbsp;(Only register at one of these two links, not both)</p>\r\n<p>Register equipment <a title=\"Q2014 Equipment Registration\" href=\"/equipment_registrations/new\" target=\"_blank\">here</a>.</p>\r\n<p>Volunteers, register your interest&nbsp;here. (Only register at one of these two links, not both) <strong>CLOSED!</strong></p>\r\n<p>USA/Canada NYI</p>',1,1,'2014-01-30 19:27:14','2014-04-26 16:43:36'),(3,'Home','Home','','<h1>Welcome to Q2014.org!</h1>\r\n<p>Interested Officials and Volunteers, click the Officials and Volunteer Registration link above to begin the process of registration for Q2014. &nbsp;Please note that until you receive verification and a special link for final registration, this is just your interest in being involved.</p>\r\n<h3>Tentative Schedule (download PDF) <a title=\"Q2014 Tentative Schedule\" href=\"http://www.quizstuff.com/Q2014 General Schedule (2014.04.01).pdf\" target=\"_blank\">click here</a>.</h3>\r\n<p><span style=\"font-size: 1.17em;\">Basic Registration Costs (Registration is Open)</span></p>\r\n<p><span style=\"text-decoration: underline;\"><strong>Individuals</strong></span></p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>Quizzer</td>\r\n<td>$180</td>\r\n</tr>\r\n<tr>\r\n<td>Coach</td>\r\n<td>$180</td>\r\n</tr>\r\n<tr>\r\n<td>Official</td>\r\n<td>$110</td>\r\n<td>(a special registration code will be emailed after pre-registration is completed &amp; approved)</td>\r\n</tr>\r\n<tr>\r\n<td>Volunteer</td>\r\n<td>$110</td>\r\n<td>(a special registration code will be emailed after pre-registration is completed &amp; approved) - <strong>PRE_REGISTRATION CLOSED!</strong></td>\r\n</tr>\r\n<tr>\r\n<td>Guests</td>\r\n<td>$165</td>\r\n<td>(all on campus registration; this includes admission, housing (5 nights, basic linens and towels with a change available on Wednesday. &nbsp;We recommend bringing your own pillow and toiletries are NOT included not is laundry facilities.), meals (15, Monday lunch through Saturday breakfast))</td>\r\n</tr>\r\n<tr>\r\n<td>Guests</td>\r\n<td>$10</td>\r\n<td>(off campus and children 3 and under $5; this only includes a badge for admission)</td>\r\n</tr>\r\n<tr>\r\n<td>Airport transportation</td>\r\n<td>$10 per person</td>\r\n<td>(from and to the Nashville Airport)</td>\r\n</tr>\r\n<tr>\r\n<td>Early housing - Sunday, June 29th only</td>\r\n<td>$11.50 per person</td>\r\n<td>(MAY NOT be the same room for the rest of the event)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"text-decoration: underline;\"><strong>Teams</strong></span></p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td>District</td>\r\n<td>$150</td>\r\n<td>Either division; Experienced or Novice</td>\r\n</tr>\r\n<tr>\r\n<td>Local</td>\r\n<td>$100</td>\r\n<td>Either division; Experienced or Novice</td>\r\n</tr>\r\n<tr>\r\n<td>Regional</td>\r\n<td>&nbsp;</td>\r\n<td>See your Regional Director for information-A &amp; B Division</td>\r\n</tr>\r\n<tr>\r\n<td>Decades</td>\r\n<td>&nbsp;$0</td>\r\n<td>Create your own team - no current quizzers</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>More specific cost information to follow soon.</p>\r\n<p>USA/Canada NYI</p>',1,0,'2014-01-30 22:54:53','2014-05-08 21:04:53'),(4,'Registration FAQs','Registration FAQs','','<div class=\"page\" title=\"Page 1\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p><span style=\"font-size: 22.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(25.490200%, 63.529410%, 62.352940%);\">Registration FAQs </span></p>\r\n<p><a href=\"/files/Registration FAQs.pdf\">Download these FAQs as a PDF.</a></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">Where do I register for Q2014? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">All participants need to register individually through the Q2014.org website. Select &ldquo;Register a Participant&rdquo; at the top of the page to enter the registration module. All individual registrations must be submitted by 11:59PM EST on Sunday, June 1, 2014. </span></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">Can I register for someone else? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">Yes. On the initial page of the registration website, enter the registrant&rsquo;s information in the fields provided. Below these fields you will find a check box stating, &ldquo;I am registering on behalf of this person&rdquo;. When you check this box, additional fields appear and you are prompted to enter your own contact information which will allow you to receive a copy of the registrant&rsquo;s confirmation email as well as give you access to view their registration details. </span></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">How do I register my non-quizzing family members? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">Non-quizzers should be individually registered as guests&mdash;whether planning to stay on-campus or off-campus. Any children age three or younger can be added to any individual registration as a guest of that registrant. There is no registration fee for children age three or younger, and no email address is required for their registration. </span></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">Am I required to have a unique email address to register? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">Yes, the system we use for online registration does require a unique email address as the &ldquo;unique identifier&rdquo; for each registrant. We realize many families share a common email address and therefore do not have a unique email address for each family member. For our event purposes, our priority is to make sure we gather the best email address to use when sharing communications regarding Q2014. Knowing this, our recommendation to work around this system requirement is as follows: </span></p>\r\n<ol style=\"list-style-type: decimal;\">\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">Register the primary family member with the active family email address. </span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">When beginning any additional family members&rsquo; registration, complete the required email field with a mock&nbsp;</span><span style=\"font-size: 10pt;\">email address in the format &ldquo;fakeemail@JohnSmith.com&rdquo; inserting the registrant&rsquo;s first and last name after&nbsp;</span><span style=\"font-size: 10pt;\">the @ symbol, therefore ensuring it will be a unique identifier.</span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">When completing the remainder of the registration questions, be sure to include the active family email&nbsp;</span><span style=\"font-size: 10pt;\">address in the CC Email field, thus ensuring any email communications intended for that registrant will also&nbsp;</span><span style=\"font-size: 10pt;\">be received by the primary family member.</span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">When preparing bulk communications regarding Q2014, our team will simply remove any emails in this&nbsp;</span><span style=\"font-size: 10pt;\">specific &ldquo;fakeemail@JohnSmith.com&rdquo; format from the mailing list.</span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">If you have any questions or encounter any trouble with the registration process, please email us at&nbsp;</span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\'; color: rgb(0.000000%, 0.000000%, 100.000000%);\"><a title=\"nyiquiz@nazarene.org\" href=\"mailto:nyiquiz@nazarene.org\">nyiquiz@nazarene.org</a> </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">or call 913.577.0550.</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">Where can I find the Medical and Liability Release Form mentioned in registration? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">The required forms mentioned in the registration system are hyperlinked to that specific question in the registration module. (Simply click on the underlined portion of that question, and the form will open in a new window.) If you have trouble accessing the forms in that location, both the adult and student forms have also been added to the Q2014.org website under &ldquo;Forms&rdquo;. When completed, these forms should be returned to the USA|Canada NYI Office by email, fax, or standard mail (information included in form). </span></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">What payment options are available on the website? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">The registration website will accept VISA or MasterCard credit card payments. If you require other payment options, please email </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\'; color: rgb(0.000000%, 0.000000%, 100.000000%);\"><a title=\"nyiquiz@nazarene.org\" href=\"mailto:nyiquiz@nazarene.org\">nyiquiz@nazarene.org</a> </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">or call 913.577.0550.</span></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"page\" title=\"Page 2\">\r\n<div class=\"layoutArea\">\r\n<div class=\"column\">\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">Can I make gradual payments toward my registration balance? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">Yes, the registration website does allow partial payments. When on the payment page, you will see a section titled &ldquo;Apply the Payment to Your Order&rdquo;. Below, you will find an itemized listing of all of the items associated with your registration and their fee. To the right, you will see an editable box entitled &ldquo;Amt Applied&rdquo;. This box will default to show the full total of your registration fees, but you may simply edit the number to read the amount you want to apply at this time. You then must click the &ldquo;Update&rdquo; button below this particular section to apply this change. You should then see a note to the right of the &ldquo;Apply&rdquo; button that should match the amount you wish to apply. If these numbers look correct, you may then enter your information in the section below to submit your payment. </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">PLEASE NOTE: All accounts must be paid in full before the close of individual registration (11:59PM EST on Sunday, June 1, 2014). </span></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">How do I modify or add information my registration? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">To do this, simply return to the registration module through Q2014.org (select &ldquo;Register a Participant&rdquo; at the top of the page) and select the &ldquo;Already Registered&rdquo; hyperlink below the Register button. You will then be asked for the email address and confirmation number associated with the registration you wish to modify. If you have misplaced your confirmation number, the website allows you to enter your email address and have the number resent to you. Once you are logged in, you will find a page with buttons titled Modify, Submit Payment, Unregister, More Options, and Print Options. While most are self-explanatory, when you choose &ldquo;Modify&rdquo;, you should be aware that the resulting screen will allow you to do three different things: </span></p>\r\n<ol>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: 700;\">Unregister </span><span style=\"font-size: 10pt;\">&ndash; if you select the box to the left of a registrant&rsquo;s name and then click &ldquo;Next&rdquo;, it will unregister that participant. </span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: 700;\">Modify Information </span><span style=\"font-size: 10pt;\">&ndash; this link will allow you to edit any of the information collected on the first page of the registration website (contact info, t-shirt size, allergies/special needs, roommate preferences, travel info, etc.). </span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'Arial\'; font-weight: 700;\">Modify Registration </span><span style=\"font-size: 10pt;\">&ndash; this link will allow you to modify any of the additional items you have purchased with your registration (airport transportation, early housing, etc.) </span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">I am a Quiz Coach...how do I assign quizzers to my team? </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">The module for assigning quizzers to individual teams is separate from the individual registration module. Therefore, quizzing coaches will need to create a username and password to access this module through the Q2014.org website. To do so, simply select &ldquo;Login&rdquo; from the menu at the top of the homepage and create your user account. Once logged in, you will then be able to claim a team, assign it to a division, and assign quizzers to that specific team (once they have completed their individual registration). To do so, follow the following steps: </span></p>\r\n<ol>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10pt;\">Select &ldquo;Claim Cvent Registration&rdquo; from the top menu on Q2014.org. </span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10pt;\">Enter your personal registration confirmation code and click &ldquo;Claim&rdquo;. (This will give you access to build the&nbsp;</span><span style=\"font-size: 10pt;\">number of teams you registered and paid for when completing your individual registration.)</span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10pt;\">Select &ldquo;Register a Team&rdquo; from the top menu to enter the required information regarding your teams. Once completed, you will be able to view a summary page, which will show each of the teams connected to your&nbsp;</span><span style=\"font-size: 10pt;\">registration. (This page can also be accessed later by clicking on \"View my team registrations.\" on the right&nbsp;</span><span style=\"font-size: 10pt;\">menu bar.)</span></p>\r\n</li>\r\n<li style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">\r\n<p><span style=\"font-size: 10pt;\">To add quizzers to a team, select \"Make Changes\" on the team registration page. Next, click \"Edit Quizzers\"&nbsp;</span><span style=\"font-size: 10pt;\">next to the team name. This will take you to a page that will show registered quizzers on your district. (If a quizzer is not listed, they likely have not yet registered or they selected a different district when registering.) Select each quizzer you wish to assign to this team and click \"Save Selections\". This can be edited as often as needed until the beginning of the event.</span></p>\r\n</li>\r\n</ol>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">PLEASE NOTE: There will be a delay in transfer of information between the individual and team registration modules. Please allow 24-36 hours for individual registration information to appear in the team registration module. If after 48 hours the individual information has not appeared in the team module and you fear an error has occurred, please contact our office by email </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\'; color: rgb(0.000000%, 0.000000%, 100.000000%);\"><a title=\"nyiquiz@nazarene.org\" href=\"mailto:nyiquiz@nazarene.org\">nyiquiz@nazarene.org</a> </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">or call 913.577.0550. </span></p>\r\n<p><span style=\"font-size: 11.000000pt; font-family: \'Arial\'; font-weight: 800; color: rgb(91.764710%, 26.666670%, 30.980390%);\">Help&mdash;my question wasn&rsquo;t answered here... </span></p>\r\n<p><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">We are happy to help! The Q2014.org website will be continually updated with new information as the event draws closer. If you cannot find the answer to your question there, please contact our office by email </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\'; color: rgb(0.000000%, 0.000000%, 100.000000%);\"><a title=\"nyiquiz@nazarene.org\" href=\"mailto:nyiquiz@nazarene.org\">nyiquiz@nazarene.org</a> </span><span style=\"font-size: 10.000000pt; font-family: \'ArialMT\';\">or call 913.577.0550.&nbsp;</span></p>\r\n</div>\r\n</div>\r\n</div>',1,1,'2014-03-28 19:27:01','2014-04-04 19:31:08'),(5,'Forms','Forms','','<h1>Participant Forms</h1>\r\n<p>Below you can find various forms you will need to complete to attend Q2014.</p>\r\n<p><a href=\"/files/Adult Medical and Liability Release.pdf\">Adult Medical and Liability Release.pdf</a></p>\r\n<p><a href=\"/files/Student Medical and Liability Release.pdf\">Student Medical and Liability Release.pdf</a></p>',1,1,'2014-03-28 21:10:06','2014-03-28 21:10:06'),(6,'Previous Q Events','Previous Q Events','','<p>Highlight Video Q2008, Nampa, ID <a title=\"Q2008 Nampa, ID\" href=\"https://www.youtube.com/watch?v=5IDVMKwrAms\" target=\"_blank\">click here</a>&nbsp;</p>\r\n<p>Group Photo Q2010, Mt. Vernon, OH <a title=\"Q2010 Group Mt. Vernon, OH\" href=\"http://www.quizstuff.com/Q2010 Group photo-2.jpg\" target=\"_blank\">click here</a>&nbsp;(this is an 11mb file)</p>\r\n<p>Group Photo Q2012, Bourbonnais, IL <a title=\"Q2012 Group Bourbonnais, IL\" href=\"http://www.quizstuff.com/Q2012_group_photo.jpg\" target=\"_blank\">click here</a></p>',1,1,'2014-04-10 20:50:19','2014-04-10 21:23:50');
